import React from "react";
import Tab from "@material-ui/core/Tab";
import Tabs from "@material-ui/core/Tabs";

const App = () => {
  const [value, setValue] = React.useState(0);

  return (
    <div
      style={{
        marginLeft: "15%",
        marginRight: "15%",
      }}
    >
      <h2>Create Tabs in ReactJS using material-ui</h2>
      <Tabs
        value={value}
        textColor="primary"
        indicatorColor="primary"
        onChange={(e, val) => {
          setValue(val);
        }}
      >
        <Tab label="TAB One" />
        <Tab label="TAB Two" />
        <Tab label="Disabled TAB" disabled />
        <Tab label="TAB Four" />
      </Tabs>
      <h3>TAB NO: {value + 1} </h3>
    </div>
  );
};

export default App;
